const Header=()=>{
    return(
        <header>
            <nav>
                <div>
                    <img src="" alt="Logo de la p&aacute;gina" className="im"/>
                </div>
                <div>
                    <Link to="">HOME</Link>
                    <Link to="">SOBRE M&Iacute;</Link>
                </div>
